import React from 'react';
 

const VediosItems = ({ vedio}) =>{
  return(
    <div className ='item'>
      <img className ="ui image" src ={vedio.snippet.thumbnails.medium.url} alt=""/>
      <div className="content">
      {vedio.snippet.title}
      </div>
    </div>
  )
} 

export default VediosItems;
